import React from "react";

const Popup = () => {
  return (
    <div className="popup">
      <div className="inner_popup">
        <p>Fund name</p>
        <p>Schemne category</p>
        <p>Schemne type</p>
      </div>
    </div>
  );
};

export default Popup;
